import React, { Component } from 'react';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import { ImageBackground, StyleSheet, Text, View, Button, Image } from "react-native";

const image = { uri: "https://image.freepik.com/free-vector/shiny-white-gray-background-with-wavy-lines_1017-25101.jpg" };

function SplashScreen({ navigation }) {
  return (
    <View style={styles.container}>

      <ImageBackground source={image} style={styles.image}>
      <View style={styles.logoContainer}>
          <Image
            source={{
              uri: 'http://drugshoppa.ng/wp-content/uploads/2020/08/cropped-DrugShoppa-1.png',

            }}
            style={styles.logo}
          />
      <Button
        title="Go to Details"
        onPress={() => navigation.navigate('Login')}
      />
      </View>
      <View style={styles.footer}>
        <Button
        title="Go to Details"
        onPress={() => navigation.navigate('Login')}
      />
      </View>
    </ImageBackground>
    </View>
  );
}

function Login({ navigation }) {
  return (
    <View style={styles.container}>
      <ImageBackground source={image} style={styles.image}>
      <Text style={styles.text}>Login</Text>
      <Button
        title="SignUp"
        onPress={() => navigation.navigate('SignUp')}
      />
    </ImageBackground>
    </View>
  );
}

function SignUp({ navigation }) {
  return (
    <View style={styles.container}>
      <ImageBackground source={image} style={styles.image}>
      <Text style={styles.text}>SignUp</Text>
      <Button
        title="Login"
        onPress={() => navigation.navigate('Login')}
      />
    </ImageBackground>
    </View>
  );
}

const Stack = createStackNavigator();

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator initialRouteName="SplashScreen">
        <Stack.Screen name="SplashScreen" component={SplashScreen} options={{ headerShown: false }}/>
        <Stack.Screen name="Login" component={Login} />
        <Stack.Screen name="SignUp" component={SignUp} />
      </Stack.Navigator>
    </NavigationContainer>
  );
}


const styles = StyleSheet.create({
  container: {
    flex: 1,
    flexDirection: "column"
  },
  image: {
    flex: 1,
    resizeMode: "cover",
    justifyContent: "center"
  },
  footer:{
    flex:2,
    flexDirection: "column",
    paddingVertical:30,
  },
  text: {
    color: "grey",
    fontSize: 30,
    fontWeight: "bold"
  },
  logoContainer: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',

  },
  logo:{
    width: 250,
    height: 56,
    marginBottom: 50,
  },
});
